import Draggable from 'react-draggable';
import { IconFileText } from '@tabler/icons-react';
import OpeningFile from '../Files/OpeningFile';
import { useState } from "react";

function OpeningFileIcon () {
    const [display, setDisplay] = useState(true);

    return (
        <div onDoubleClick={() => !display ? setDisplay(!display) : null}>
            <Draggable>
                <div className="flex flex-col items-center">
                    <IconFileText color="white" size={48} />
                    <p className="text-white">
                        Opening.txt
                    </p>
                </div>
            </Draggable>
            {display ? <OpeningFile display={display}/> : null}
        </div>
    )
}

export default OpeningFileIcon;
